INSERT INTO `device_reglament_element` VALUES (43,'Проверить то',82,3,'2019-10-18 06:26:15','2020-01-09 01:26:07','2020-01-09 01:26:07'),(44,'Проверить се',82,3,'2019-10-18 06:26:16','2020-01-09 01:26:10','2020-01-09 01:26:10'),(45,'работа1',83,3,'2019-12-31 02:17:16','2019-12-31 02:17:16',NULL),(46,'Внешни',84,3,'2019-12-31 02:28:47','2019-12-31 02:37:07','2019-12-31 02:37:07'),(47,'1. Снять шлейфы сигнализации с дежурства. 1 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(48,'2. Отключить прибор от сети переменного тока и резервного источника питания (АКБ, РИП), удалить с поверхности прибора пыль, грязь и влагу. 5 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(49,'3. Снять крышку прибора и удалить с поверхности клемм, предохранителей пыль, грязь, следы коррозии. 3 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(50,'4. Удалить с поверхности аккумулятора пыль, грязь, влагу. Измерить напряжение резервного источника, в случае полного разряда заменить АКБ. 1 мин',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(51,'5. Проверить исправность и соответствие номиналу предохранителей. 1 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(52,'6. Проверить соответствие подключения внешних цепей к клеммам колодок. 1 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(53,'7. Проверить прочность винтовых соединений всех внешних подключений прибора. 1 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(54,'8. Подтянуть винты на клеммах, где крепление ослабло. Восстановить соединение, если провод оборван. 2 мин',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(55,'9. Внешним осмотром убедиться в отсутствии нарушений изоляции соединительных проводов. Заменить провода, где нарушена изоляция. 2 мин.',98,3,'2020-01-09 02:14:16','2020-01-09 05:54:59','2020-01-09 05:54:59'),(56,'10. Подключить прибор к сети переменного тока, подключить АКБ. 1 мин.',98,3,'2020-01-09 02:14:17','2020-01-09 05:54:59','2020-01-09 05:54:59'),(57,'11. Произвести сброс неисправностей и сработок для пожарных ШС с помощью однократного нажатия на кнопки соответствующих ШС (перепостановка ШСП на охрану), а также сброс общих неисправностей по прибору, с помощью однократного нажатия кнопки «ПУСК/СБРОС».',98,3,'2020-01-09 02:14:17','2020-01-09 05:54:59','2020-01-09 05:54:59'),(58,'12. Провести контроль светодиодов, кнопок, внутреннего звукового сигнализатора, тестовые запуски внешних оповещателей (Со, Си, Та) в режиме \"Тест\".',98,3,'2020-01-09 02:14:17','2020-01-09 05:54:59','2020-01-09 05:54:59'),(59,'1. Выполнить пункты 1-11 Регламента №1. 21 мин.',99,3,'2020-01-09 02:28:44','2020-01-09 05:55:10','2020-01-09 05:55:10'),(60,'2. Проверить работоспособность прибора. Провести имитацию срабатывания извещателей и проверить прием прибором извещений и выдачу сигналов и команд во внешние цепи. 4 мин.',99,3,'2020-01-09 02:28:44','2020-01-09 05:55:10','2020-01-09 05:55:10'),(61,'3. Проверить работоспособность прибора при отсутствии основного питания  Отключить от прибора основное питание.  Выполнить операции по п.п. 1…2 настоящего регламента.  Подключить к прибору основное питание. 5 мин.',99,3,'2020-01-09 02:28:44','2020-01-09 05:55:10','2020-01-09 05:55:10'),(62,'3. Проверить работоспособность прибора при отсутствии основного питания  Отключить от прибора основное питание.  Выполнить операции по п.п. 1…2 настоящего регламента.  Подключить к прибору основное питание. 5 мин.',99,3,'2020-01-09 02:28:44','2020-01-09 05:55:10','2020-01-09 05:55:10'),(63,'5. Проверить величину сопротивления утечки на шлейфах сигнализации. Сопротивление утечки между проводами ШС должно быть не менее: 20 кОм для охранного шлейфа и 50 кОм для пожарного шлейфа. 15 мин.',99,3,'2020-01-09 02:28:44','2020-01-09 05:55:10','2020-01-09 05:55:10'),(64,'6. Выполнить п.12 Регламента №1.',99,3,'